import React from 'react';
import logo from './logo.svg';
import './App.css';

import {
  BrowserRouter as Router,
} from 'react-router-dom';

function Nav() {
  return (
      <nav className="Nav">
        <div className="Nav-left">
          <Link className="Nav-item"
            to='/'>
            Lorem
          </Link>
	  <Link className="Nav-item"
            to='/ipsum'>
            Ipsum
          </Link>
	  <Link className="Nav-item"
            to='/dolor'>
            Dolor
          </Link>
	  <Link className="Nav-item"
            to='/sit-amet'>
            Sit Amet
          </Link>

        </div>
        <div className="Nav-right">
          <a className="Nav-brand"
            href="/" >
            Lorem Ipsum
          </a>
        </div>
      </nav>
  );
}

function Main() {
  return (
      <Switch>
	<Route path='/' >
      	  <h2>Lorem</h2>
    	</Route>
	<Route path='/ipsum' >
      	  <h2>Ipsum</h2>
    	</Route>
	<Route path='/dolor' >
      	  <h2>Dolor</h2>
    	</Route>
	<Route path='/sit-amet' >
      	  <h2>Sit Amet</h2>
    	</Route>
      </Switch>
  );
}


function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
	<Main />
      </div>
    </Router>
  );
}

export default App;
